import React, { useState, useEffect } from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(latest => {
                let sick = [];

                console.log(latest);

                sick[0] = latest.latest;
                sick[1] = latest.confirmed;
                sick[2] = latest.recovered;

                setData(sick)
            })
    })


    return (
    <div>
      <h1>CORONA</h1>

    </div>
    );
}

export default App;
